function getSamples(index = -1){
    samples = []
    samples.push({
        camera:"CameraRGB0",
        name: "image_00006.png",
        pos:0.0,
        data_url:`
        data:image/png;base64,
    `
    });
    samples.push({
        camera:"CameraRGB1",
        name: "image_00336.png",
        pos:0.5,
        data_url:`
        data:image/png;base64,
    `
    });
    samples.push({
        camera:"CameraRGB2",
        name: "image_00696.png",
        pos:-0.3,
        data_url:`
        data:image/png;base64,
    `
    });
    samples.push({
        camera:"CameraRGB3",
        name: "image_00906.png",
        pos:1.0,
        data_url:`
        data:image/png;base64,
    `
    });
    samples.push({
        camera:"CameraRGB4",
        name: "image_00771.png",
        pos:-1.3,
        data_url:`
        data:image/png;base64,
    `
    });
    samples.push({
        camera:"CameraRGB5",
        name: "image_00726.png",
        pos:2.0,
        data_url:`
        data:image/png;base64,
    `
    });
    if (index>-1){
        return samples[index]
    }

    return samples
}

function setInputToSample(index){
    sample = getSamples(index)
    document.getElementById('input_image').src = sample.data_url;
    document.getElementById('input_image').name = sample.name;
    document.getElementById('input_image_abs_pos').value = sample.pos;
}

function decorateSamples(){
    var samples = getSamples();
    sample_container = document.getElementById('samples');
    samples.forEach((element,index) => {
        var button = document.createElement("button");
        button.innerText = element.camera;
        button.setAttribute('onclick', 'setInputToSample('+index+')');
        sample_container.append(button)
    });
}

decorateSamples();